import React from 'react';
import './MySkills.css'; // Import your CSS file for styling

const MySkills = () => {
  const skills = [
    { name: 'Web Development', level: 2 },       // Using a scale of 1 to 3 for simplicity
    { name: 'UI/UX Design', level: 2 },
    { name: 'Docker', level: 1 },
    { name: 'Jenkins', level: 1 },
    { name: 'Terraform', level: 2 },
    { name: 'AWS', level: 3 },
  ];

  const getSkillLevelStars = (level) => {
    const maxStars = 3;
    return '★'.repeat(level) + '☆'.repeat(maxStars - level);
  };

  return (
    <section className="my-skills py-5">
      <div className="container">
        <h2 className="text-right mb-4">My Skills</h2>
        <div className="row">
          {skills.map((skill, index) => (
            <div className="col-md-4 mb-4" key={index}>
              <div className="card skill-card">
                <div className="card-body">
                  <h5 className="card-title">{skill.name}</h5>
                  <p className="card-text">
                    Skill Level: {getSkillLevelStars(skill.level)}
                  </p>
                </div>
              </div>
            </div>
          ))}
        </div>
      </div>
    </section>
  );
};

export default MySkills;
